  render() {
    return <div><Component/></div>
  }
}

class Comp2 extends Component {
    render() {
      return <div>Comp1</div>
    }
}

class Comp3 extends Component {
    render() {
      return <div>Comp1</div>
    }
}

export {Comp,Comp1,Comp2,Comp3}
